import React, { useState } from "react";
import Form1 from "./Form1";
import Form2 from "./Form2";
import Form3 from "./Form3";

export default function CombinedForm({csrfToken}) {
    const [value, setValue] = useState("1");

const handleClick = (event) => {
    const value = event.target.value;
    if (value == "1"){
        setValue(value);
    }
    else if(value == "2"){
        setValue(value);
    }
    else if(value == "3"){
        setValue(value);
    }
};
if (value == '1'){
    return (
    <div>
    <button value="2"
    onClick={handleClick} className="btnstyle" title="To Cut Section From Field">Form2</button>
    <button value="3"
    onClick={handleClick} className="btnstyle" title="To Calculate Area Of Land">Form3</button>
    <button value="1"
    onClick={handleClick} className="btnstyle" >Home</button>
    <Form1 csrfToken={csrfToken} />
    </div>
);
}
else if (value == '2'){
    return (
    <div>
    <button value="1"
    onClick={handleClick} className="btnstyle">Form1</button>
    <button value="3"
    onClick={handleClick} className="btnstyle">Form3</button>
    <button value="1"
    onClick={handleClick} className="btnstyle">Home</button>
    <Form2 csrfToken={csrfToken} />
    </div>
);
}
else if (value == '3'){
    return (
    <div>
    <button value="1"
    onClick={handleClick} className="btnstyle">Form1</button>
    <button value="2"
    onClick={handleClick} className="btnstyle">Form2</button>
    <button value="1"
    onClick={handleClick} className="btnstyle">Home</button>
    <Form3 csrfToken={csrfToken} />
    </div>
);
}
}
